INSERT INTO `shows` (`id`, `showName`, `source`, `img`, `desc`, `host`, `internal_link`, `ext_link`, `email`, `duration`, `slug`)
VALUES
	(78,'Morning Soul Shake-Up!','cfru','https://www.cfru.ca/wp-content/uploads/2020/07/soulimage.jpeg','<p>Start your day right with a joyful mix of rare vintage soul, r&b and funk!  A righteous mix, brought to you every day of the week from 8-9am.  A dynamite soundtrack for the breakfast table, the cafe or the commute.  Get up to get down!!</p>','Slim Volume','https://www.cfru.ca/?s=Morning%20Soul%20Shake-Up%21&posttype_search=mcm_recording','','bw@cfru.ca',3600,'cfru-morning-soul-shake-up'),
	(79,'Breezy Breakfast Radio','cfru','https://www.cfru.ca/wp-content/uploads/2020/07/podbean-image-1.jpg','<p>The Breezy Breakfast is a weekly community gathering focused on raising awareness and sharing ideas about important issues that concern residents of Guelph and beyond. From 2016 to 2020 this weekly gathering took place at the Breezy Corners Restaurant in downtown Guelph. Since the restaurant closed at the onset of the pandemic, the gatherings have moved online using the ZOOM platform, expanding our mandate beyond those able to attend in person, and it’s these meetings that will be shared in audio form on CFRU.</p>','Various','https://www.cfru.ca/?s=Breezy%20Breakfast%20Radio&posttype_search=mcm_recording','','',3600,'cfru-breezy-breakfast-radio'),
	(80,'CFRU Playlist','cfru','https://www.cfru.ca/wp-content/uploads/2020/06/cfru-playlist-cover-image-1.png','','CFRU!','https://www.cfru.ca/?s=CFRU%20Playlist&posttype_search=mcm_recording','','',3600,'cfru-cfru-playlist'),
	(81,'The Sentinel’s Marvellous Kaleidoscope','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/SMK_FullSize_CFRUBanner.jpg','<p>Through this lens, you will be guided on audible explorations, gazing across the ever-changing horizon of music. The fantastical soundscape is filled with landmarks, relics and anomalies in progressive, fusion and alternative styles, near and far. Each observational session is constellatory, pulverizing, mystifying… and simply marvellous.</p>','Nicholas Cooper','https://www.cfru.ca/?s=The%20Sentinel%26%238217%3Bs%20Marvellous%20Kaleidoscope&posttype_search=mcm_recording','https://linktr.ee/smkobserves','smk@cfru.ca',3600,'cfru-the-sentinels-marvellous-kaleidoscope'),
	(82,'Big Sis Radio','cfru','https://www.cfru.ca/wp-content/uploads/2022/08/Big-Sis-Radio-Thing.png','<p>Fresh indie rock tunes with host CC- your big sis with the soon-to-be-hits. We dance, tap, buzz and belt here but a special exception is made for introverts. Come hang out and find your next favourite indie band.</p>','CC','https://www.cfru.ca/?s=Big%20Sis%20Radio&posttype_search=mcm_recording','','',3600,'cfru-big-sis-radio'),
	(83,'to know the land','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/to-know-the-land.jpg','<p>a show about connections to and struggles in defence of the natural world. interviews, readings, and rants interspersed with hardcore, modern classical, and ambient music.</p>','byron','https://www.cfru.ca/?s=to%20know%20the%20land&posttype_search=mcm_recording','https://www.toknowtheland.com/','toknowtheland@gmail.com',3600,'cfru-to-know-the-land'),
	(84,'Blues Around the Block','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Blues-Pic.jpg','<p>Everything from folk to rockin’ electric and all stops in between. Occasionally veering off the rails into the unknown, it’s still all blues all the time. If you love the blues, we’ve got ’em and a whole lot Mo’.</p>','Mac Dee','https://www.cfru.ca/?s=Blues%20Around%20the%20Block&posttype_search=mcm_recording','','',3600,'cfru-blues-around-the-block'),
	(85,'Ripcord Radio','cfru','https://www.cfru.ca/wp-content/uploads/2020/08/logo.png','<p>Ripcord Radio is here to bring you 50,000 watts of punk rock from past to present. Stop & listen to a wide variety of loud, fast, dirty and sometimes weird music springing up from the underground.</p>','Jamie','https://www.cfru.ca/?s=Ripcord%20Radio&posttype_search=mcm_recording','','ripcordradio.cfru@gmail.com',3600,'cfru-ripcord-radio'),
	(86,'The Deep House Project','cfru','https://www.cfru.ca/wp-content/uploads/2019/02/unnamed.png','<p>Welcome to the Deep House Project. The show is an exploration of early deep house and its influences on modern music. The show plays classic club tracks in contrast with contemporary sounds while always spending time recognizing Canadian contributions.</p>','Aaron Blair','https://www.cfru.ca/?s=The%20Deep%20House%20Project&posttype_search=mcm_recording','https://www.facebook.com/DHPCFRU/','dhpcfru@gmail.com',3600,'cfru-the-deep-house-project'),
	(87,'Back in the USSR','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/proletarian-internationalism.jpg','<p>Music and cultural history from the former communist block, and rebel music from around the world!</p>','Seigfried Barazov','https://www.cfru.ca/?s=Back%20in%20the%20USSR&posttype_search=mcm_recording','https://proletarianguardbackintheussr.blogspot.com/','USSR@cfru.ca',3600,'cfru-back-in-the-ussr'),
	(89,'Terrible Horrible Breakfast','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>Welcome to an eclectic tour through the weird, loud, dark, and/or strange side of music. A breakfast show for creatures of the night who would really rather not be awake at 9am.</p>','Edie','https://www.cfru.ca/?s=Terrible%20Horrible%20Breakfast&posttype_search=mcm_recording','','',3600,'cfru-terrible-horrible-breakfast'),
	(90,'Bridging The Social Distance','cfru','https://www.cfru.ca/wp-content/uploads/2020/03/49667588068_c3ed4dc50a_b.jpg','<p>A show that aims to give a platform for sharing ideas, perspectives and feelings in the wake of the Global COVID-19 pandemic. Interviews will feature local Guelphites as well as people living elsewhere around the world.</p>','Jenny Mitchell','https://www.cfru.ca/?s=Bridging%20The%20Social%20Distance&posttype_search=mcm_recording','','volunteer@cfru.ca',3600,'cfru-bridging-the-social-distance'),
	(91,'Tuesday at 5','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','','Mac Dee','https://www.cfru.ca/?s=Tuesday%20at%205&posttype_search=mcm_recording','','',3600,'cfru-tuesday-at-5'),
	(92,'Ear Candy','cfru','','<p>Serving up candy for your ears. Showcasing music both new and old, while supporting up and coming artists from Canada and around the globe! Tune in every Tuesday at 6pm for Ear Candy!</p>','Adrian Straatsma','https://www.cfru.ca/?s=Ear%20Candy&posttype_search=mcm_recording','','',3600,'cfru-ear-candy'),
	(93,'Melonaut Radio','cfru','https://www.cfru.ca/wp-content/uploads/2021/07/Thumb.png','Melonaut Radio is a new exciting and chaotic open-concept progressive music podcast with elements of audio drama, interviews and storytelling. Formed under the tagline “genre is a construct”, Melonaut encompasses the core idea of prog as music that takes the listener on a journey, but welcomes a variety of music and genres that are prog in spirit, from darkwave to dark ambient and beyond. Hosted by Alia Synesthesia (podcast “Angelina Takes Requests”), siberian/canadian composer, trained operatic singer and multi-instrumentalist. FB: /melonautradio','Alia Synesthesia','https://www.cfru.ca/?s=Melonaut%20Radio&posttype_search=mcm_recording','https://melonaut.aliasynesthesia.com/','',3600,NULL),
	(94,'Let’s Get Lost','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Lets-Get-Lost.jpg','<p>Let’s Get Lost uses jazz as a staging area for discovery missions into other genres that inform jazz and into music that jazz affects (or infects).</p>','Scott Crockard','https://www.cfru.ca/?s=Let%26%238217%3Bs%20Get%20Lost&posttype_search=mcm_recording','','crockard@golden.net',3600,'cfru-lets-get-lost'),
	(95,'Humanoid Radio','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/humanoid-radio-banner-2020-rev.png','<p>A collage of experimental, electronic, ambient, and world music, incorporating spoken word.</p>','Alan Kirker','https://www.cfru.ca/?s=Humanoid%20Radio&posttype_search=mcm_recording','http://alankirker.com/humanoidradio/','',3600,'cfru-humanoid-radio'),
	(96,'Cyber Lich’s Gothic Castle','cfru','https://www.cfru.ca/wp-content/uploads/2022/10/DALL·E-2022-08-04-15.33.21-a-fantasy-drawing-of-a-giant-ominous-gothic-castle-in-the-night-lit-up-by-lightning-while-a-cyber-lich-cackles.png','<p>Step into the world of cybernetic darkness. Feel the deranged reverberations of the darkest of darksynth, dark ambient,.dungeon synth, and anything else eerie enough to send you screaming back to Arkham. The Cyber Lich awaits you.</p>','Cyber Lich','https://www.cfru.ca/?s=Cyber%20Lich%26%238217%3Bs%20Gothic%20Castle&posttype_search=mcm_recording','','',3600,'cfru-cyber-lichs-gothic-castle'),
	(97,'Wild Combination','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>There is something inherently magical about radio. So with this show I hope to play a ‘wild combination’ of music that I find strange or beautiful, to encourage late night moments of magic through listening.</p>','Jake Parker Scott','https://www.cfru.ca/?s=Wild%20Combination&posttype_search=mcm_recording','','',3600,'cfru-wild-combination'),
	(98,'Puerto Almendro','cfru','https://www.cfru.ca/wp-content/uploads/2020/01/PUERTO-ALMENDRO-Maria-Neder.jpg','','Maria Neder','https://www.cfru.ca/?s=Puerto%20Almendro&posttype_search=mcm_recording','http://www.marianeder.com.ar','marianeder@gmail.com',3600,NULL),
	(99,'The Stillness & The Dancing','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/The-Stillness-The-Dancing.jpg','<p>Searching for the sublime in the simple? Give your ears some solace with highlights from the world of ambient, drone, electronic, neoclassical and post-rock. A quiet corner of sonic comfort food in a chaotic world. Soon to be your favourite introverted musical retreat.</p>','Joel Cuthbert','https://www.cfru.ca/?s=The%20Stillness%20%26%23038%3B%20The%20Dancing&posttype_search=mcm_recording','http://thestillnessandthedancing.tumblr.com/','thestillnessandthedancing@cfru.ca',3600,'cfru-the-stillness-the-dancing'),
	(100,'We Know Some Stuff + CFRU playlist','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>We Know Some Stuff: Scientists of Tomorrow Talking Today</p><p>Why are my house plants always dying? Do computers experience heartbreak? Will chocolate solve all my problems? We know the answers … well, mostly. Current and recent graduate students talk candidly about their science and how it helps us better understand life’s little questions. Unscripted, unedited, and understandable science that is fun to listen to, shaking up the traditional science radio show format.</p>','Louis C. Colaruotolo','https://www.cfru.ca/?s=We%20Know%20Some%20Stuff%20%2B%20CFRU%20playlist&posttype_search=mcm_recording','https://www.louiscolaruotolo.com/','',3600,'cfru-we-know-some-stuff-cfru-playlist'),
	(101,'Seems Like Old Times','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Seems-Like-Old-Times.jpg','<p>Music and old time radio from the 1930’s to 1950’s, plus information and commentary that’s distinctively Doug!</p>','Doug Blackwood','https://www.cfru.ca/?s=Seems%20Like%20Old%20Times&posttype_search=mcm_recording','','dblackwoodrogers@hotmail.com',3600,'cfru-seems-like-old-times'),
	(102,'End Credits','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/End-Credits.jpg','<p>End Credits is a new weekly radio show on CFRU. The point of our show is movies: movie news and movie reviews. Our is a show dedicated to local movie fans, by local movie fans. We discuss and debate the latest news items in the realm of film and TV development in the first half, and after a music break we do an in-depth review of a movie recently released to theatres, streaming sites, or on demand.</p>','Adam Donaldson and others','https://www.cfru.ca/?s=End%20Credits&posttype_search=mcm_recording','','adamadonaldson@gmail.com',3600,'cfru-end-credits'),
	(103,'Keep Your Metres','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>A fill-in music show of new Canadian music, to get us through our Covid days.</p>','Jenny Mitchell','https://www.cfru.ca/?s=Keep%20Your%20Metres&posttype_search=mcm_recording','','volunteer@cfru.ca',3600,'cfru-keep-your-metres'),
	(104,'New Frontiers','cfru','https://www.cfru.ca/wp-content/uploads/2022/01/aaronwrixoncfru.png','<p>Che Guevara asked “What do we leave behind when we cross each frontier?” Get ready to find out—with the most adventurous avant-garde jazz and creative music on the dial.</p>','Aaron Wrixon','https://www.cfru.ca/?s=New%20Frontiers&posttype_search=mcm_recording','','',3600,'cfru-new-frontiers'),
	(105,'B Siide Radio','cfru','https://www.cfru.ca/wp-content/uploads/2021/11/AAEBE2EE-5B0D-4C1F-A15B-F07D0A187768.jpeg','<p>B Siide Radio, Bringing you the best in Hip Hop, R&B and everything In between. Shining a light on some of the best up-and-coming Canadian artists in the game!</p>','Mike Kivell','https://www.cfru.ca/?s=B%20Siide%20Radio&posttype_search=mcm_recording','','',3600,'cfru-b-siide-radio'),
	(106,'Trail Mix','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/CFRU-Eternal-Rhythm-photo-resized.jpg','<p>A hearty blend of rock, folk, jazz and country music.</p>','Dave Snider','https://www.cfru.ca/?s=Trail%20Mix&posttype_search=mcm_recording','http://eternalrhythmradioshow.blogspot.com/','eternalrhythm@cfru.ca',3600,'cfru-trail-mix'),
	(107,'Tone Zone','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Tone-Zone.jpg','<p>Show description coming soon!</p>','Dunster and Matt','https://www.cfru.ca/?s=Tone%20Zone&posttype_search=mcm_recording','','',3600,'cfru-tone-zone'),
	(108,'Wind-Down','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>a program that offers you a selection of musical vibes to help you drift into the night. Starts off with high energy beats that get progressively dreamier through the show.</p>','Serra Willow','https://www.cfru.ca/?s=Wind-Down&posttype_search=mcm_recording','https://thewinddowncfru.blogspot.com/','',3600,'cfru-wind-down'),
	(109,'Radia','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Radia.jpg','<p>Radia is a network of independent radio stations, who have a common interest in promoting and producing artworks for the radio, and in forming related projects based on broadcasting and cultural exchange. Radia members produce a weekly radio show that is broadcast by each of the member radio stations. The shows represent the local artistic community of each station, whilst at the same time these new works point to an emergent collective notion of self-determined art for radio.</p>','Various','https://www.cfru.ca/?s=Radia&posttype_search=mcm_recording','','',3600,'cfru-radia'),
	(110,'Here Today','cfru','https://www.cfru.ca/wp-content/uploads/2022/04/Screen-Shot-2022-07-16-at-5.09.26-PM.jpeg','','Aaron Badgley','https://www.cfru.ca/?s=Here%20Today&posttype_search=mcm_recording','','',3600,'cfru-here-today'),
	(111,'Tales from the Bridge','cfru','https://www.cfru.ca/wp-content/uploads/2021/06/TFTB-Header.jpg','<p>You can always find more Tales From The Bridge on Apple Podcasts our website, you can also find us on Twitter, Instagram, and Facebook to see what is happening on The Bridge.</p><p>Check out our many links!</p><p>Apple Podcasts:</p><p>#podcast #sciencefiction #scifi #scifipodcast #applepodcasts #soundtrack #cinematicsound #composer #starwars #imperialmarch</p>','Tristan, Marty, Kevin, and Sam','https://www.cfru.ca/?s=Tales%20from%20the%20Bridge&posttype_search=mcm_recording','','',3600,'cfru-tales-from-the-bridge'),
	(112,'FoodFarm Talk','cfru','https://www.cfru.ca/wp-content/uploads/2019/03/FFT-For-CFRU.png','<p>FoodFarm Talk:</p><p>Food is life: We eat to live, and if there is anything worth celebrating, then it is food and the people behind it.</p><p>FoodFarm Talk is an interactive program that builds on the diversity of food research here at the University of Guelph and the strong agricultural and food community of the City of Guelph, to bring to listeners, among others, some of the wonderful works, being done from farm to fork. The program shows and celebrates the research, the people, and the activities that define the food we eat.</p>','Abdul-Rahim Abdulai, Emily Duncan, and Paul Smith','https://www.cfru.ca/?s=FoodFarm%20Talk&posttype_search=mcm_recording','https://anchor.fm/foodfarmtalk','',3600,'cfru-foodfarm-talk'),
	(113,'Android’s Dungeon','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/basement_stylised.jpg','<p>Enter the Android’s Dungeon with hosts Jack and Joel on a weekly show that discusses board and video games and their creators, the mechanics in them, and the culture around them. Give us a shout at androidsdungeon@cfru.ca or on twitter @ADRadioCFRU!</p>','Jack and Joel','https://www.cfru.ca/?s=Android%26%238217%3Bs%20Dungeon&posttype_search=mcm_recording','https://twitter.com/ADRadioCFRU','androidsdungeon@cfru.ca',3600,'cfru-androids-dungeon'),
	(114,'Listen Up','cfru','','Show description coming soon!','Jack','https://www.cfru.ca/?s=Listen%20Up&posttype_search=mcm_recording','','',3600,'cfru-listen-up'),
	(115,'RadiOPIRG','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','','Omorowa Eguakun and Mandy Hiscocks','https://www.cfru.ca/?s=RadiOPIRG&posttype_search=mcm_recording','','',3600,'cfru-radiopirg'),
	(116,'T.K.O.','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/T.K.O..jpg','<p>From analyzing fights to paying tribute to legendary athletes, T.K.O. keeps you updated on the hottest issues that surround the world of Mixed Martial Arts and combat sports. Beast mode is guaranteed!</p>','Janan','https://www.cfru.ca/?s=T.K.O.&posttype_search=mcm_recording','','',3600,'cfru-t-k-o'),
	(117,'Café International','cfru','https://www.cfru.ca/wp-content/uploads/2022/10/Cafe-International-Take-Two.jpg','<p>Join host Dan Rosenberg on a radio series featuring interviews with musicians from around the world, from Fatoumata Diawara to Goran Bregović where we learn about folk music and its history.</p>','Daniel Rosenberg','https://www.cfru.ca/?s=Caf%C3%A9%20International&posttype_search=mcm_recording','','',3600,'cfru-cafe-international'),
	(118,'Open Sources Guelph','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Open-Sources-Guelph.jpg','<p>Open Sources Guelph is a weekly news, politics and current events radio show on CFRU 93.3 FM, campus and community radio in Guelph. Picking up the baton passed down by the Beyond the Ballot Box and Gang of Four shows, Open Sources will remain a dedicated, informative and alternative media source in the Royal City. Our mission is to bring Guelph all the latest news, insight and interviews on both the big issues of the day, and the issues being overlooked by the mainstream media. You can listen to Open Sources live, every Thursday at 5 pm by tuning your radio 93.3 FM or you can listen to us online at cfru.ca. Open Sources Guelph is hosted and produced by Scotty Hertz McWhinnie (The Working Week) and Adam A. Donaldson (Guelph Politico).</p>','Scotty Hertz & Adam Donaldson','https://www.cfru.ca/?s=Open%20Sources%20Guelph&posttype_search=mcm_recording','','',3600,'cfru-open-sources-guelph'),
	(119,'Turtle Island Underground','cfru','https://www.cfru.ca/wp-content/uploads/2022/05/Turtle-Island-Underground-revised.png','','Mac','https://www.cfru.ca/?s=Turtle%20Island%20Underground&posttype_search=mcm_recording','','',3600,'cfru-turtle-island-underground'),
	(120,'The Crooked Beat','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/The-Crooked-Beat.jpg','<p>One of CFRU’s longest running and most beloved shows! Listen to Reggae, Dancehall, Ska & Rock Steady of all ages, styles and origins. “Don’t forget your history, know your destiny, In the abundance of water the fool is thirsty” (Bob Marley)</p>','Nicky Dread','https://www.cfru.ca/?s=The%20Crooked%20Beat&posttype_search=mcm_recording','http://nickydread.tripod.com/','nickydread@gmail.com',3600,'cfru-the-crooked-beat'),
	(121,'Sundowner','cfru','','<p>Finally, a show that brings the experience of staring out a bus window with headphones on to the airwaves. Tune in every other week for a selection of beloved gems, new releases, and left turns guaranteed to make today’s worries drift out of sight as you keep rolling.</p>','Matt Hollingshead','https://www.cfru.ca/?s=Sundowner&posttype_search=mcm_recording','','',3600,'cfru-sundowner'),
	(122,'Forever Deaf','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>Dean has been on the air since 1987, and Forever Deaf has been in this format since 1989. Dean plays all forms of extreme metal music and hardcore.</p>','Dean','https://www.cfru.ca/?s=Forever%20Deaf&posttype_search=mcm_recording','','',3600,'cfru-forever-deaf'),
	(123,'Thanks for Listening :)','cfru','https://www.cfru.ca/wp-content/uploads/2021/10/Thanks-4-Listening.jpg','<p>Thanks For Listening</p>','Megan Arnold','https://www.cfru.ca/?s=Thanks%20for%20Listening%20:%29&posttype_search=mcm_recording','','',3600,'cfru-thanks-for-listening'),
	(124,'Planet Groove','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Planet-GrooveOL.jpg','<p>A history of underground rock, r&b, punk and more!</p>','Funky Blues Doctor','https://www.cfru.ca/?s=Planet%20Groove&posttype_search=mcm_recording','','',3600,'cfru-planet-groove'),
