	(132,'Global Rare Grooves','cfru','','<p>Dancefloor-oriented music from around the world that is jazz, funk and disco adjacent. Music from Africa, the Caribbean, Europe, South America, Southeast Asia, and North America with a special focus on Canadian artists. The program will play a mix of vintage and contemporary tunes, from the 1960s to the present day.</p>','Sam Cee','https://www.cfru.ca/?s=Global%20Rare%20Grooves&posttype_search=mcm_recording','','',3600,'cfru-global-rare-grooves'),
	(133,'The Illest','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','Start your weekend off right with a mix of 90’s and modern-day hip hop! Each week on the Illest we break down the sound coming out various regions across the US and look at the revolutionary artists that pioneered hip hop.','Caelen McCabe','https://www.cfru.ca/?s=The%20Illest&posttype_search=mcm_recording','','',3600,'cfru-the-illest'),
