	(135,'Folk Roots Radio','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/folk-roots-radio.jpg','<p>If folk, roots, country and blues are your thing you’ll find them all during this genre hopping show. Grab your favourite morning brew and settle down for two hours of music and more to start your Saturday! If you are a musician and you want to play live in the studio, get in touch. We’d love to hear from you!</p>','Jan Hall','https://www.cfru.ca/?s=Folk%20Roots%20Radio&posttype_search=mcm_recording','http://folkrootsradio.com/','jan@folkrootsradio.com',3600,'cfru-folk-roots-radio'),
