	(138,'Sound Magic','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>Michael Doleschell’s survey of recent releases of concert art music, featuring forgotten or neglected figures from the margins of history till today. Specializing in the rare, bizarre or obscure.</p>','Michael Doleschell','https://www.cfru.ca/?s=Sound%20Magic&posttype_search=mcm_recording','','',3600,'cfru-sound-magic'),
