	(140,'Caribbean Anthology','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/a-dogs-breakfast-1.jpg','<p>Join us as we take you on a musical ride, exploring the depths of West Indian music from the yesteryear to our current day. Come take a musical round trip in our Time Machine: Caribbean Anthology.</p>','Keon (DOC)','https://www.cfru.ca/?s=Caribbean%20Anthology&posttype_search=mcm_recording','','',3600,'cfru-caribbean-anthology'),
	(141,'Alternativa Latinoamericana','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Alternativa-Latinoamericana.jpg','<p>Reflects Latin America’s reality, from literature and news to important social and political issues, A place for information in Spanish for those who want to know what’s happening in their countries of origin as well as their own communities in Canada.</p>','Collective','https://www.cfru.ca/?s=Alternativa%20Latinoamericana&posttype_search=mcm_recording','','',3600,'cfru-alternativa-latinoamericana'),
