	(146,'The Kookoo Bananas Variety Hour','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/The-Kookoo-Bananas-Variety-Hour.jpg','<p>The Kookoo Bananas Variety Hour is a family-friendly show jam-packed with kiddie records, weirdo pop culture, and songs sung by robots, animals, and even kids! Hosted by Cap’n Kookoo & The Banana Brats.</p>','Curtis Walker & kids','https://www.cfru.ca/?s=The%20Kookoo%20Bananas%20Variety%20Hour&posttype_search=mcm_recording','https://www.cfru.ca/www.facebook.com/KookooBananas','kookookoobananas@gmail.com',3600,'cfru-the-kookoo-bananas-variety-hour'),
	(147,'One Turntable and a Microphone','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>I bought a turntable! Join me as I play my records on this newfangled technology and talk about the history and future of the turntable and records in general. I’m new to all of this, so I’ll be learning with you! I’ll also be doing a deep dive on the records that I spin and generally will cover one album per show. I’ll be exploring how they were recorded and what was good or bad about them, and learning some interesting musical trivia! This should be fun!</p>','Mark Hallman','https://www.cfru.ca/?s=One%20Turntable%20and%20a%20Microphone&posttype_search=mcm_recording','','',3600,'cfru-one-turntable-and-a-microphone'),
	(148,'Clan Na Gael','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Clan-Na-Gael.jpg','<p>Clan-na-Gael is one of CFRU’s longest running shows. Host John Fahy features Celtic/Folk music from around the world and around the corner. The music played originates in Canada, USA, Australia, Wales, Scotland, Cornwall in England, Brittany in France & Ireland. The Show particularly features local, regional and national artists with approx. 50% Canadian content weekly.</p>','John Fahy (regular host) & sometimes McDee','https://www.cfru.ca/?s=Clan%20Na%20Gael&posttype_search=mcm_recording','','clannagael@cfru.ca',3600,'cfru-clan-na-gael'),
	(149,'La Buena Onda','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/La-Buena-Onda.jpg','<p>The best of the best from Latin America, including reggaeton, pop, rock, salsa, bachata, merengue, cumbia and all of the newest sounds.</p>','DJ Andito','https://www.cfru.ca/?s=La%20Buena%20Onda&posttype_search=mcm_recording','','labuenaonda@live.com',3600,'cfru-la-buena-onda'),
	(150,'Zombie Jamboree','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Zombie-Jamboree-1.jpeg','<p>An international, cross-genre dance party that isn’t afraid to delve into the shadows, Zombie Jamboree is your weekly re-animator.</p>','B-Sides Mathews','https://www.cfru.ca/?s=Zombie%20Jamboree&posttype_search=mcm_recording','','zombiejamboree@cfru.ca',3600,'cfru-zombie-jamboree'),
