	(156,'Pot Pourri','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','“Pot-Pourri Show” – Toute la diversté du monde sur votre fréquence. Un magazine culturel francophone, concept original 100%. Un regard différent sur l’actualité et les grands enjeux et défis de la francophonie. Cinéma / Musique / Spectacles/ Jeux-concours / Livres / Humour / Culture / Politique / LGBTQIA+. En partenariat avec Radio France Internationale, l’Université de Toronto, EducNation Consulting Inc., Noire & Psy, Cinéfranco, Kilimandjaro Radio/TV',' Eric, Ron, Morgane','https://ciut.fm/shows/pot-pourri/','http://potpourrishow.com/','potpourri@ciut.fm',7200,'ciut-pot-pourri'),
	(157,'33-45-78','ciut','https://ciut.fm/wp-content/uploads/2020/05/Steve-Fruitman.jpg','An all vinyl music program mined from my own record collection. I bought my first LP in April 1964 and haven’t stopped buying them since. So let’s listen to them on 33.45.78',' Steve Fruitman','https://ciut.fm/shows/33-45-78/',NULL,'334578@ciut.fm',7200,'ciut-33-45-78'),
	(158,'The Radical Reverend','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','Think all those in faith communities are misogynist homophobic idiots? Think again! Religion and politics no matter what you believe shape the world. Listen to the Revolutionary Rantings of the Radical Reverend and other heretics!',' Cheri DiNovo','https://ciut.fm/shows/the-radical-reverend/',NULL,'radicalreverend@ciut.fm',3600,'ciut-the-radical-reverend'),
	(159,'Career Buzz','ciut','https://ciut.fm/wp-content/uploads/2020/06/Shellie-Deloyer-Headshot-683x1024.jpg','Since 2006, we’ve broadcast unrehearsed and informative conversations featuring extraordinary career stories of ordinary people, and insights from future-of-work thought leaders including Dragon’s Den star Arlene Dickinson, Canada’s career guru Barbara Moses, National Geographic explorer-in-residence Wade Davis, and career scholars Norm Amundson, John Krumboltz and many more.','','https://ciut.fm/shows/career-buzz/',NULL,'careerbuzz@ciut.fm',3600,'ciut-career-buzz'),
	(161,'Viento Sur','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','A journey through the diverse musical Bolivian landscape.',' Marco Lopez','https://ciut.fm/shows/viento-sur/',NULL,'vientosur@ciut.fm',3600,'ciut-viento-sur'),
	(162,'Gospel Music Machine','ciut','https://ciut.fm/wp-content/uploads/2020/06/brogee1-1024x926.jpg','The Gospel Music Machine is one of the longest running gospel music programs on radio in Canada. The program features a blend of gospel hits from various genres, along with current affairs, news and interview segments. The show provides a forum for current local and international Christian artists, while initiating new ventures for emerging talent. It also serves as an information sourcefor what’s happening on the international and local gospel scene.',' Courtney Williams and Richard Gordon aka (BroGee)','https://ciut.fm/shows/gospel-music-machine/','https://gospelmusicmachine.wordpress.com/','gospelmusicmachine@gmail.com',10800,'ciut-gospel-music-machine'),
	(163,'CIUT Critics Circle','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','We cover the arts and politics on this show. Listen weekly for: Film reviews with Film Critic Daniel Garber of culturalmining.com and Theatre reviews with our Passionate Playgoer and Theatre Critic Lynn Slotkin (Formerly of the CBC).',' Phil Taylor','https://ciut.fm/shows/ciut-critics-circle/',NULL,NULL,3600,'ciut-ciut-critics-circle'),
	(164,'Beyond the Headlines','ciut','https://ciut.fm/wp-content/uploads/2020/05/Beyond-the-Headlines-1.jpg','Beyond the Headlines is a weekly one-hour current affairs radio show & podcast airing on Mondays at 11AM on CIUT 89.5. Through discussions with leading Canadian and global experts, we aim to capture the essence of important public policy and global affairs issues. By taking a “deep dive” into a new subject each week, our objective is to take listeners beyond the immediacy of our daily news. We aspire to create content that is accessible to a wider audience, not simply those who have an academic background in policy. BTH is produced by Master’s students within the ',NULL,'https://ciut.fm/shows/beyond-the-headlines/','https://www.beyondtheheadlines.net/','beyondtheheadlines@ciut.fm',3600,'ciut-beyond-the-headlines'),
	(166,'Moovin In the Right Direction','ciut','https://ciut.fm/wp-content/uploads/2020/06/IMG_0709-rotated.jpg','Heard every Thursday, the program features established and emerging talent both locally and internationally with a prime focus on independent Electronic music. Through guest DJ sets, artist interviews, event previews and reviews, emerging artists share the same platform with established ones creating a unique experience challenging the status quo in radio. ',' David James','https://ciut.fm/shows/moovin-in-the-right-direction/',NULL,'moovinintherightdirection@ciut.fm',10800,'ciut-moovin-in-the-right-direction'),
	(167,'Funky Fridays','ciut','https://ciut.fm/wp-content/uploads/2020/07/funky-fridays_ciut_logo-website-photo.jpg','Covering 6 decades of funk with a touch of soul!','  Mr. Pete, Dr. Mouth','https://ciut.fm/shows/funky-fridays/',NULL,'funkyfridays@ciut.fm',10800,'ciut-funky-fridays'),
	(168,'Drill Squad','ciut','https://ciut.fm/wp-content/uploads/2020/06/0-2-934x1024.jpeg','The best thing you’ll hear at 6am.',' DJ Dred-E-Maximum & DJ Magic Tricks','https://ciut.fm/shows/drill-squad/',NULL,'thedrillsquad@ciut.fm',10800,'ciut-drill-squad'),
	(169,'Indigenous Waves','ciut','https://ciut.fm/wp-content/uploads/2022/11/Jennifer-Sylvester.jpg','Jennifer Sylvester MEd, (She/Her) is in the third year of her Ph.D. in Leadership, Higher and Adult Education at University of Toronto - OISE. Deep family roots from Chimnissing  (Beausoliel) First Nation, but she was born and raised in Toronto. She is an advocate for Indigenous social issues, such as equity, protection, and Inclusion of Indigenous women. She\'s a hobbyist, crafter, and a single parent to a 16-year-old.  ',' Jenny Blackbird and Jennifer Sylvester','https://ciut.fm/shows/indigenous-waves/',NULL,'indigenouswaves@ciut.fm',3600,'ciut-indigenous-waves'),
	(170,'Ruby Slippers','ciut','https://ciut.fm/wp-content/uploads/2020/06/Ruby-Slippers-Carol-Barrett-IMG_3670.jpg','Music fiend passionate about the power of community radio. Veteran programmer back for another round on CIUT. All artists are welcome, new and older, from near and far. It\'s all about the music, I\'m just the host...',' Carol Barrett','https://ciut.fm/shows/ruby-slippers/',NULL,'carolbonciut@ciut.fm',3600,'ciut-ruby-slippers'),
	(171,'Second To the Right','ciut','https://ciut.fm/wp-content/uploads/2022/03/ohio-phils-inn.jpg','Broadcasting in the deep end of the nighttime, Second to the Right is three hours of eclectic music, poetry, and surprises, all presented with wit, intelligence, and acumen. Come visit and prepare for the beginning of the workaday week. Requests are encouraged.',' Brad Reed ','https://ciut.fm/shows/second-to-the-right/',NULL,'secondtotheright@ciut.fm',10800,'ciut-second-to-the-right'),
	(173,'Club Ned','ciut','https://ciut.fm/wp-content/uploads/2020/07/club-ned_ciut_db-hawkes-web-photo-768x1024.jpg','Late night mix like no other brought to you by DB Hawkes.',' DB Hawkes','https://ciut.fm/shows/club-ned/',NULL,'dbhawkes@ciut.fm',21600,'ciut-club-ned'),
	(174,'Global Rhythms','ciut','https://ciut.fm/wp-content/uploads/2020/06/98353479_293245375021760_3318519585199620096_n-768x1024.jpg','Travel the world through music without leaving your living room.',' Ken Stowar','https://ciut.fm/shows/global-rhythms/',NULL,'globalrhythms@ciut.fm',10800,'ciut-global-rhythms'),
	(175,'No Man’s Land','ciut','https://ciut.fm/wp-content/uploads/2022/11/DJ-medicineman-CIUT-Show-Page.jpeg','Richard ‘Medicineman’ Martin is Canada’s premier global groove DJ. His sets flow seamlessly from Indo Arabic Dub to Afro Gypsy Electronica, mixing primitive rhythms with progressive beats.',' DJ Medicineman','https://ciut.fm/shows/no-mans-land/',NULL,'nomansland@ciut.fm',7200,'ciut-no-mans-land'),
	(177,'The Prophecy','ciut','https://ciut.fm/wp-content/uploads/2020/06/52141172_10157126648938980_2681517867244978176_o.jpg','For 17 years, Prophecy Radio has been the hub for Toronto’s DNB community. Every week our listeners get the most upfront bass cultured music around!',' Scott Free, Mr. Brown & Polaris','https://ciut.fm/shows/the-prophecy/',NULL,'theprophecy@ciut.fm',7200,'ciut-the-prophecy'),
	(178,'EqualizingXDistort','ciut','https://ciut.fm/wp-content/uploads/2020/06/EXD-Stephe-Rob-Jose-Waves-scaled.jpg','Underground hardcore punk with periodic scene histories, monthly top 10s and weekly demo features.',' Stephen Perry, Rob Ferraz, Dave Stevenson, and Christian Overall','https://ciut.fm/shows/equalizingxdistort/','http://equalizingxdistort.blogspot.com/','equalizingxdistort@gmail.com',7200,'ciut-equalizingxdistort'),
	(179,'Groove Concept Radio','ciut','https://ciut.fm/wp-content/uploads/2020/06/IMG_0319.jpg','Groove Concept Radios content mirrors the melting pot of musical genres and has carved a niche for itself as the home of Jazz, RB, Soul, hip-hop  left-field sounds. soul Hosted by Emile Weekes, the shows goal is to always deliver message music, with an emphasis on lyrical content and a perfect groove.',' Emile Weekes','https://ciut.fm/shows/groove-concept-radio/',NULL,'grooveconceptradio@ciut.fm',7200,'ciut-groove-concept-radio'),
	(180,'Howl','ciut','https://ciut.fm/wp-content/uploads/2020/06/Valentino.png','Valentino Assenza has been a published poet and performing spoken word artist for over the last two decades. In that time he has released four chapbooks and performed all over Canada and the US.  Valentino has been a co-host and co-producer of HOWL on CIUT 89.5FM, where he has interviewed names such as George Elliott Clarke, Anne Michaels, Denise Donlon, Ron Sexsmith, and Margaret Atwood.',' Valentino Assenza','https://ciut.fm/shows/howl/',NULL,'howl@ciut.fm',3600,'ciut-howl'),
	(181,'Reggae Riddims','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','The best reggae you’ve ever heard.',' Patrick Roots','https://ciut.fm/shows/reggae-riddims/','https://www.podomatic.com/podcasts/reggaeriddims','rasta@ciut.fm',7200,'ciut-reggae-riddims'),
	(182,'No Beat Radio','ciut','https://ciut.fm/wp-content/uploads/2020/05/20200512_080559-scaled.jpg','Join Minesh Mandoda and No Beat Radio for a seamless journey through a world of unbound sound. Each show features both new and unknown ‘classics’ from Toronto and beyond that connect genres from electronica, folk, free jazz, garage, hip-hop, punk, krautrock and new world. From time to time a few guests and performances.',' Minesh Mandoda','https://ciut.fm/shows/no-beat-radio/','https://soundcloud.com/nobeatradio','nobeatradio@ciut.fm',3600,'ciut-no-beat-radio'),
	(183,'What Is Hip?','ciut','https://ciut.fm/wp-content/uploads/2020/06/Screenshot_20190105-142307_Facebook.jpg','Jazz, Latin-jazz, Jazz-Funk, Jazz-Fusion, SteelyDan.  This is how the JazzFix rolls every week from 8 to 9pm.  From 9 to 10pm - The lounge mix shifts gears into a DJ Set to round out the show.',' DjGoldfinger','https://ciut.fm/shows/what-is-hip/',NULL,'whatiship@ciut.fm',7200,'ciut-what-is-hip'),
	(184,'Six Degrees','ciut','https://ciut.fm/wp-content/uploads/2020/05/image0.jpeg','Playing the best hidden gems and underground Hip-hop, Dub, Grime, Soul, R & B, from around the world. Includes interviews from local up-and-coming musicians and people behind the scenes. Chances are that your new favourite song was played here first.',' DJ SLAM! & Mlny','https://ciut.fm/shows/six-degrees/',NULL,'6degrees@ciut.fm',7200,'ciut-six-degrees'),
	(185,'A to Z Blues','ciut','https://ciut.fm/wp-content/uploads/2020/05/Screamin-Red-300x293.png','An introduction for many and an reintroduction for others to the forgotten blues artists in context with today’s performers.',' Screamin’ Red & Howlin\' Wolf Boy','https://ciut.fm/shows/a-to-z-blues/',NULL,'atozbluesonciut@gmail.com',3600,'ciut-a-to-z-blues'),
	(186,'Higher Ground','ciut','https://ciut.fm/wp-content/uploads/2020/06/IMGP1543-scaled.jpg','Funk, soul, and everything in between.',' Jason Palma','https://ciut.fm/shows/higher-ground/',NULL,NULL,7200,'ciut-higher-ground'),
	(187,'Dreaming In Stereo','ciut','https://ciut.fm/wp-content/uploads/2020/06/Dreaming-in-Stereo-scaled.jpg','This weekly show is hosted by Alexandra, U of T alumni and avid concertgoer. The music featured is a diverse mix of indie, rock, folk and electronic new releases. The focus is on uplifting local and international sounds and music news and announcements.',' Alexandra Simion','https://ciut.fm/shows/dreaming-in-stereo/','http://www.dreaminginstereo.ca/','dreaminginstereo@ciut.fm',3600,'ciut-dreaming-in-stereo'),
	(188,'Masterplan','ciut','https://ciut.fm/wp-content/uploads/2020/07/MASTERPLAN_TMPS-LOGO-PNG-1024x1024.png','Celebrating over 30 years Hip Hop in your city and across Canada & U.S.A. worldwide. The Master Plan show started in 1989 with John Adams, Wendy Brathwaite aka Motion, Derrick aka Dj Power and Dave Clarke aka DJ DTS. The Masterplan show is run by the members of the community with volunteers from all across the city. DJ DTS is still on the show as a mentor for Generation Next founded by Dj Romeo aka Matthew Romeo and DTS, to give help and support to the younger generation who are interested in radio production, spoken word, Dj-ing, and life skills just to name a few. ','','https://ciut.fm/shows/masterplan/',NULL,NULL,7200,'ciut-masterplan'),
	(189,'Vinyl From the Crypt','ciut','https://ciut.fm/wp-content/uploads/2020/06/20181012_150341.jpg','The Show for Audiophiles! For over a dozen years, Vinyl From The Crypt has given CIUT listeners and supporters the opportunity to come and present a 2-hour program featuring vinyl recordings from their personal collections.',' Sean Mitchell','https://ciut.fm/shows/vinyl-from-the-crypt/',NULL,'vinylfromthecrypt@ciut.fm',7200,'ciut-vinyl-from-the-crypt'),
	(190,'The Bassment Sessions','ciut','https://ciut.fm/wp-content/uploads/2020/06/Dubmatix-CIUT.jpg','Bassment Sessions is a weekly music mix focusing on reggae, dub, funk, jungle, hip-hop and beyond. ',' Dubmatix','https://ciut.fm/shows/the-bassment-sessions/',NULL,NULL,3600,'ciut-the-bassment-sessions'),
	(191,'Frisson Radio','ciut','https://ciut.fm/wp-content/uploads/2020/06/Frission-Radio.jpg','Frisson has its origin as a French word, which translates to a thrill or shiver akin to goose bumps. Those pore raising feelings are the emotions we seek to evoke as we curate music  & provide Canadian artists, producers and DJs with a platform for exposure and expression.',' Mikhael (Miks) Lamont & Nabeel Pervaiz','https://ciut.fm/shows/frisson-radio/',NULL,'frissonradio@ciut.fm',7200,'ciut-frisson-radio'),
	(192,'Veritable Infusion','ciut','https://ciut.fm/wp-content/uploads/2020/06/20200520_013706-scaled.jpeg','VERITABLE INFUSION is one of several French translations for Naturally Flavoured. That is the only common denominator going on here; the music is naturally flavoured, crashing and gliding through many styles, from really old country and blues to dalliances with psychedelia, a lot of soul and funk from around the world, and usually topped off with a dose of reggae. Most weeks I insert some theme which is hoped to add some edification to the entertainment. Themes vary from the earliest Canadians to make American hits to the respective soul scenes of various countries, states and / or cities. An international music party going ‘All around the world for the funk’…',' DJ Erik T','https://ciut.fm/shows/veritable-infusion/','https://veritableinfusion.podomatic.com/','veritableinfusion@ciut.fm',7200,'ciut-veritable-infusion'),
	(193,'Classical Underground','ciut','https://ciut.fm/wp-content/uploads/2020/06/Philip-Conlon.png','Discover rare classical music gems and hear great stories too.',' Philip Conlon','https://ciut.fm/shows/classical-underground/',NULL,'classicalunderground@ciut.fm',7200,'ciut-classical-underground'),
	(194,'Radio Boogie','ciut','https://ciut.fm/wp-content/uploads/2020/06/IMG_0597-rotated.jpg','Radio Boogie focuses on today’s listener, the inclusion of Graham Mansfield on the show has guaranteed its youthful face.  Bluegrass and old-Tyne music is today’s “folk” music, it is forever changing and forever relevant in today’s changing world of traditional musics.  ',' Steve Pritchard','https://ciut.fm/shows/radio-boogie/',NULL,'radioboogie@ciut.fm',7200,'ciut-radio-boogie'),
	(195,'Dementia 13','ciut','https://ciut.fm/wp-content/uploads/2020/11/IMG-2150.jpg','Musical rarities from the other side of the Psychedelic Era. Early Prog Rock, Acid, Sunshine Pop, Garage, Beat, Freak Folk and Psychedelia of all sorts; the period’s best gems on 33-45 rpm.','Christian Hamilton','https://ciut.fm/shows/dementia-13/','https://www.facebook.com/dementia13radio/','dementia13radio@gmail.com',7200,'ciut-dementia-13'),
	(196,'Across the Universe','ciut','https://ciut.fm/wp-content/uploads/2020/05/91767915_10158588047969575_526689013419999232_o.jpg','A weekly musical and sonic journey connecting the pieces of an ever expanding mosaic of sound, interspersed with the delivery of small-chat of a human interest nature with some lyrical and mildly philosophical content.','  Ken Stowar','https://ciut.fm/shows/across-the-universe/',NULL,'acrosstheuniverse@ciut.fm',10800,'ciut-across-the-universe'),
	(197,'Phil’s Inn','ciut','https://ciut.fm/wp-content/uploads/2022/03/ohio-phils-inn.jpg','Brad Reed has been involved in campus/community radio as on-air programmer since the 1970s. These past few years he has been honoured to be appointed General Manager/Custodian of Phil’s Inn. Drop in on Saturday afternoons, pull up a chair, sit by the fireplace, and take off your thirsty boots. Stay for awhile. Requests encouraged.',' Brad Reed','https://ciut.fm/shows/phils-inn/',NULL,NULL,7200,'ciut-phils-inn'),
	(198,'Ultra Latino','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-Michelle-3330-sm.jpg','Tune in to Ultra Latino every Sunday from 2-3pm on CIUT 89.5 FM! We’re playing the best Latin music… new and old on your FM radio!',' Michelle (Dj Chelli)','https://ciut.fm/shows/ultra-latino/',NULL,'ultralatinoradio@gmail.com',3600,'ciut-ultra-latino'),
	(199,'The Lovecast','ciut','https://ciut.fm/wp-content/uploads/2020/08/FB-Profile.png','Dave O Rama takes you on a journey through his schizophonic ears. From roots and blues to electronic moods, from orchestral to free form, dub stylistics, Latin soul psychedelics, global grooves, Afrocentric moves, and whatever other sonic delectables he digs up to stir into the pot.',' Dave O Rama','https://ciut.fm/shows/the-lovecast/',NULL,'lovecast@ciut.fm',7200,'ciut-the-lovecast'),
	(200,'Karibuni','ciut','https://ciut.fm/wp-content/uploads/2020/06/thierno-and-nadine.jpg','A celebration of the cultures and music from the African continent.',' Nadine McNulty and Thierno Soumare','https://ciut.fm/shows/karibuni/',NULL,'karibuni@ciut.fm',7200,'ciut-karibuni'),
	(201,'The More the Merrier','ciut','https://ciut.fm/wp-content/uploads/2021/08/donna-g.jpg','donna g has been involved with CIUT 89.5 FM for almost 25 years. From being a member of the feminist collective \"By All Means\" in the 90\'s, to co-hosting the Caribbean-Filipino fusion show \"baba(eh) mama\" in the early 2000\'s to her present solo show, \"The More the Merrier.\" donna g has made it her goal to bring film, theatre and arts-at-large coverage to the broadest possible audience.',' donna g','https://ciut.fm/shows/the-more-the-merrier/',NULL,'tmtmwithdonnag@ciut.fm',3600,'ciut-the-more-the-merrier'),
	(203,'The Bill King Show','ciut','https://ciut.fm/wp-content/uploads/2020/06/Bill-King-scaled.jpg','New music, cultural waves, faces in the news, fresh ideas, a glimpse at the past, the sounds of the future – all done with humour, clarity and a determination to share the best in all of us.',' Bill King','https://ciut.fm/shows/the-bill-king-show/','https://www.mixcloud.com/6345789/the-bill-king-show-with-kim-stockwood-ciut-895-fm/','thebillkingshow@ciut.fm',3600,'ciut-the-bill-king-show'),
	(204,'Meditation-Relaxation-Chill','ciut','https://ciut.fm/wp-content/uploads/2020/12/newchill.jpg','Join us each Friday from 1- 3 pm for a mix of meditative, relaxing, and chill sounds and positive vibrations to help you through the remainder of your day.',NULL,'https://ciut.fm/shows/meditation-relaxation-chill/',NULL,'ken.stowar@ciut.fm',7200,'ciut-meditation-relaxation-chill'),
	(205,'Music At High Noon','ciut','https://ciut.fm/wp-content/uploads/2020/06/Music-at-High-Noon.png','Two hour open format music program. Genres include a variety of rock, surf, blues, jazz, funk, soul, and reggae.',' Mike Tadros','https://ciut.fm/shows/music-at-high-noon/',NULL,'highnoon@ciut.fm',7200,'ciut-music-at-high-noon'),
	(206,'The Minx Sessions','ciut','https://ciut.fm/wp-content/uploads/2020/06/40138933_10156334687820325_4252347171585654784_o.jpg','A musical appreciation show! Serving up new and old in abstract jazz, electronic, techno, deep house, soul, funk and anything to get you movin’!',' Binny the Minx','https://ciut.fm/shows/the-minx-sessions/','https://theminxsessions.com/','theminxsessions@ciut.fm',7200,'ciut-the-minx-sessions'),
	(207,'Music With DB Hawkes','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png',NULL,' DB Hawkes','https://ciut.fm/shows/music-with-db-hawkes/',NULL,'dbhawkes@ciut.fm',7200,'ciut-music-with-db-hawkes'),
	(209,'Turn Out Radio','ciut','https://ciut.fm/wp-content/uploads/2020/06/Turn-Out-Radio-Logo.jpg','Turn Out Radio is an innovative and engaging talk show which incorporates the latest in dance news within the national and international spectrum of current events. The broadcast platform connects with spotlighted guests to discover the heart of what moves us, and the latest in the news of our day. From critical perspectives on history to performance highlights, dance health news, and the real stories that live both on and beyond the stage.',' Nicole Hamilton','https://ciut.fm/shows/turn-out-radio/','http://turnoutradio.com/','turnoutradio@ciut.fm',3600,'ciut-turn-out-radio'),
	(211,'Slipmat and Friends','ciut','https://ciut.fm/wp-content/uploads/2020/06/IMG_2972-rotated.jpg','Slipmat & Friends can be described as the sound of Herbie Hancock and King Diamond fighting over what to put on the turntable. Every Tuesday morning at midnight.',' Robert Trevisan','https://ciut.fm/shows/slipmat-and-friends/',NULL,'slipmatandfriends@ciut.fm',7200,'ciut-slipmat-and-friends'),
	(212,'Soundtracks For the Alpha State','ciut','https://ciut.fm/wp-content/uploads/2020/06/Chris-Durand.jpg','The host for Soundtracks for the Alpha State, Chris has over ten years of experience on air, having started in Buffalo at WBNY before hopping the border in 2013. Combining indie tunes, a snarky personality, and a bit of camp, things are always weird when he\'s on air.',' Chris Durand','https://ciut.fm/shows/soundtracks-for-the-alpha-state/',NULL,'chris.durand@ciut.fm',7200,'ciut-soundtracks-for-the-alpha-state'),
	(216,'Raw','ciut','https://ciut.fm/wp-content/uploads/2022/02/IMG_20211119_193311_108.jpg','Take flight Friday\'s @ 8PM, all vinyl selection of dusty gems, sample gold, and rare grooves from around the world. ',' Kalliopi Telidis & Ariel Samonte','https://ciut.fm/shows/raw/',NULL,'raw@ciut.fm',7200,'ciut-raw'),
	(217,'Moondog’s Ballroom','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','You ain’t no punk you punk; this here’s the real junk! The best on Rawk n’ Roll from the roots til the future; Punk, Rockabilly, Surf, Garage, Psyche, Cowpunk, Psychobilly, Honky Tonk, Blues, Swing, Doo Wop, Soul and Gospel just like the Good Lord intended.',' Daibhid James','https://ciut.fm/shows/moondogs-ballroom/','http://moondogsplaylists.blogspot.com/','moondogsballroom@ciut.fm',3600,'ciut-moondogs-ballroom'),
	(218,'The Taylor Report','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','We talk to informed people with a fresh point of view. The topics are war, peace, resistance, etc.',' Phil Taylor','https://ciut.fm/shows/the-taylor-report/',NULL,'thetaylorreport@ciut.fm',3600,'ciut-the-taylor-report'),
	(219,'Electric Sense','ciut','https://ciut.fm/wp-content/uploads/2020/06/2020-05-15-01.11.47-scaled.jpg','All sorts of unusual. Electronic, experimental, improvised, modern orchestral/chamber composition, sound poetry, whatever else falls into weird. Mostly from the last few years with occasional trips down memory lane.',' James Bailey','https://ciut.fm/shows/electric-sense/',NULL,'electricsense@ciut.fm',3600,'ciut-electric-sense'),
	(247,'Calling All Blues','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','Four rotating hosts produce a diversity of blues and related music (roots, soul, R&B, jazz, gospel, funk, & more) from classic / traditional to contemporary, solo acoustic to electric bands, and local to international, with personal stories and contextual history, across the range of over a century of blues music.',' Blues Doctor Julie, Sugar Brown, and Brooke Blackburn','https://ciut.fm/shows/calling-all-blues/',NULL,'callingallblues@ciut.fm',3600,'ciut-calling-all-blues'),
	(257,'Psychedelic/Stoner Rock Extravaganza','ciut','https://ciut.fm/wp-content/uploads/2021/08/psychedelic-300x205.jpg','An uninterrupted mix of recent, new and modern psychedelic and stoner rock sounds for your ears and mind.',NULL,'https://ciut.fm/shows/psychedelic-stoner-rock-extravaganza/',NULL,'ken.stowar@ciut.fm',7200,'ciut-psychedelic-stoner-rock-extravaganza'),
	(280,'Tracks From Abroad','ciut','https://ciut.fm/wp-content/uploads/2021/11/Thumbnail-copy-300x290.png','Tracks From Abroad amplifies diverse voices at the University of Toronto through international music and open-minded discussion. We feature weekly interviews with international students, U of T professors, and local artists to learn more about the multicultural city of Toronto, Canada.',' Jesse McDougall','https://ciut.fm/shows/tracks-from-abroad/',NULL,'tracksfromabroad@ciut.fm',3600,'ciut-tracks-from-abroad'),
	(289,'The Next Stop','ciut','https://ciut.fm/wp-content/uploads/2022/05/Sage-CIUT.jpg','The Next Stop is the soundtrack to your night. Each episode follows a loose theme that draws from film scores and explores music from a wide range of genres and regions. We\'ll travel from 90\'s Boom-Bap to Space Age Pop to Tuareg Desert Blues to Peruvian Cumbia to 19th Century folk songs to celestial ambient tracks and everything in between for 2 hours every week.',' Sage Ranaldo','https://ciut.fm/shows/the-next-stop/',NULL,'thenextstop@ciut.fm',7200,'ciut-the-next-stop'),
	(292,'The Cool Side of the Pillow','ciut','https://ciut.fm/wp-content/uploads/2022/03/cool-side-of-the-pillow.png','Join us each Monday morning from 12-2am for The Cool Side of the Pillow edition of Meditation, Relaxation, Chill featuring a mix of meditative, relaxing, and chill sounds and positive vibrations to help you through the remainder of your week.',NULL,'https://ciut.fm/shows/the-cool-side-of-the-pillow/',NULL,'ken.stowar@ciut.fm',7200,'ciut-the-cool-side-of-the-pillow'),
	(296,'The Third Face','ciut','https://ciut.fm/wp-content/uploads/2021/12/3rdface.jpg','The Third Face is commonly known as \"the face you hide from the world\" but this show is anything but an existential statement.  The show is meant to bring new tracks to light that awaken the joy of discovering new music as an exciting hobby, or an hourly distraction!','  Victor Kovaleski','https://ciut.fm/shows/the-third-face/',NULL,'thethirdface@ciut.fm',3600,'ciut-the-third-face'),
	(1013,'Parallel Careers + CFRU Playlist','cfru','https://www.cfru.ca/wp-content/uploads/2022/02/Parallel-Careers-Podcast-Image.jpg','Parallel Careers is a show for creative writers—and the writers who teach them. The show features Canadian writers who are at the top of their game in both craft and pedagogy. Tune in to hear the big ideas and practical tips they take into their classrooms and their own craft.','','https://www.cfru.ca/?s=Parallel%20Careers%20%2B%20CFRU%20Playlist&posttype_search=mcm_recording','','',3600,NULL),
	(1060,'Fridays at Five','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/a-dogs-breakfast-3.jpg','Discover emerging art and artists in Guelph while they showcase their personalities through interviews and games!','Amara Sheppard','https://www.cfru.ca/?s=Fridays%20at%20Five&posttype_search=mcm_recording','','',3600,NULL),
	(1163,'Parallel Careers','cfru','https://www.cfru.ca/wp-content/uploads/2022/02/Parallel-Careers-Podcast-Image.jpg','<p>Parallel Careers is a show for creative writers—and the writers who teach them. The show features Canadian writers who are at the top of their game in both craft and pedagogy. Tune in to hear the big ideas and practical tips they take into their classrooms and their own craft.</p><p>Credits/team: Parallel Careers is produced by Claire Tacon, in partnership with The New Quarterly literary magazine. Erin MacIndoe Sproule is our Technical Producer and Story Editor. Music composed by Amadeo Ventura. Financial and in-kind support provided by the The Region of Waterloo Arts Fund, St. Jerome’s University, and the Government of Canada.</p>','','https://www.cfru.ca/?s=Parallel%20Careers&posttype_search=mcm_recording','','',3600,'cfru-parallel-careers'),
	(1321,'Hong Kong Student Radio Association','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Hong-Kong-Student-Radio-Association.jpg','<p>Interviews, original radio plays, and community news in Cantonese and Mandarin.</p>','Various','https://www.cfru.ca/?s=Hong%20Kong%20Student%20Radio%20Association&posttype_search=mcm_recording','','hongkong@uoguelph.ca',3600,'cfru-hong-kong-student-radio-association'),
	(1344,'Beautiful Druid','cfru','https://www.cfru.ca/wp-content/uploads/2020/09/863F24D6-A669-47DB-9BD5-348BA141211A-1.jpeg','','Alden Hadwen','https://www.cfru.ca/?s=Beautiful%20Druid&posttype_search=mcm_recording','','',3600,'cfru-beautiful-druid'),
	(1437,'Democracy Now','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/democracy-now.jpg','<p>With award-winning journalists Amy Goodman and Juan Gonzalez, Democracy Now is a national, daily, independent, award-winning news program airing on over 140 stations in North America.</p>','Amy Goodman','https://www.cfru.ca/?s=Democracy%20Now&posttype_search=mcm_recording','https://www.democracynow.org/','',3600,'cfru-democracy-now'),
	(1438,'Worst Responders','cfru','','<p>Relationship troubles, work drama, or complicated life stuff that you just</p>','Renee and Charissa','https://www.cfru.ca/?s=Worst%20Responders&posttype_search=mcm_recording','','',3600,'cfru-worst-responders'),
	(1447,'Rainbow Country','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>Mark Tara is your guide through RAINBOW COUNTRY, a show that offers a blend of music & interviews giving voice to the LGBT community</p>','Mark Tara','https://www.cfru.ca/?s=Rainbow%20Country&posttype_search=mcm_recording','http://www.marktara.com/','rainbowcountry@ciut.fm',3600,'cfru-rainbow-country'),
	(1451,'What Do You Know?','cfru','','<p>Long-form interviews!</p>','Gaon','https://www.cfru.ca/?s=What%20Do%20You%20Know%3F&posttype_search=mcm_recording','','',3600,'cfru-what-do-you-know'),
	(1453,'Silver Screen Dream Machine','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Silver-Screen-Dream-Machine.jpg','<p>Silver Screen Dream Machine is a collective approach to anything and everything to do with cinema, through interviewing people in and around the community who are involved with independent cinema, movie reviews and Bookshelf Cinema listings. We are always looking for contributors, so contact us if you are interested!</p>','Electrified Voltage and Boston Carlyle','https://www.cfru.ca/?s=Silver%20Screen%20Dream%20Machine&posttype_search=mcm_recording','','silverscreen@cfru.ca',3600,'cfru-silver-screen-dream-machine'),
	(1455,'Down the Rabbit Hole','cfru','','<p>Down the Rabbit Hole! Each week we’ll be looking at an artist and going down the rabbit hole of their musical journey! Whether this is through listening to their influences, checking out similar artists they’ve worked with, or exploring other musicians who may have been influenced themselves, the goal of this show is to showcase the million little threads that connect musicians in the industry!</p>','Hans Haryanto','https://www.cfru.ca/?s=Down%20the%20Rabbit%20Hole&posttype_search=mcm_recording','','',3600,'cfru-down-the-rabbit-hole'),
	(1464,'Gryphon And Special Olympics Sports Show','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Gryphon-And-Special-Olympics-Sports-Show.jpg','<p>There are sports to report, and Boston, Taylor and David have a boatload of things you’ve got to hear! It’s a free form celebration of sports and songs from all eras and styles, including hot new releases from local and Canadian artists. Don’t miss this dynamic team in action!</p>','Taylor, David and Boston Carlyle','https://www.cfru.ca/?s=Gryphon%20And%20Special%20Olympics%20Sports%20Show&posttype_search=mcm_recording','','bostoncarlyle@gmail.com',3600,'cfru-gryphon-and-special-olympics-sports-show'),
	(1491,'Industry Tactics','cfru','https://www.cfru.ca/wp-content/uploads/2023/02/industry-tactics.jpg','<p>Join Friendly Rich as he interviews some of the finest outsiders in Canadian music!</p>','Friendly Rich','https://www.cfru.ca/?s=Industry%20Tactics&posttype_search=mcm_recording','','',3600,'cfru-industry-tactics');
